import React from 'react';

function Contact() {
  return (
    <div className="section" id="contact">
      <h2>Contact</h2>
      <div className="contact-buttons">
        <a href="mailto:antoine.levy27@gmail.com" className="contact-btn">Email</a>
        <a href="https://www.linkedin.com/in/antoine-l%C3%A9vy-653106201/" target="_blank" rel="noopener noreferrer" className="contact-btn">LinkedIn</a>
        <a href="https://x.com/AntoineLevy27" target="_blank" rel="noopener noreferrer" className="contact-btn">Twitter</a>
        <a href="https://github.com/AntoineLevyy" target="_blank" rel="noopener noreferrer" className="contact-btn">GitHub</a>
      </div>
    </div>
  );
}

export default Contact;
